INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 0, 102601, 24, 1, 24001, "あたしだって\nやるときはやるよ！", "リン", 10040, "2030/12/17 14:59:59", 1, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 1, 102601, 24, 1, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 10040, "2030/12/17 14:59:59", 1, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 2, 102601, 24, 1, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 10040, "2030/12/17 14:59:59", 1, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 3, 102601, 24, 2, 24004, "やったね！\nこれでようやく\nサボれるよ…", "リン", 10040, "2030/12/17 14:59:59", 2, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 4, 102601, 24, 1, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 10040, "2030/12/17 14:59:59", 1, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 5, 102601, 24, 2, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 10040, "2030/12/17 14:59:59", 2, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 6, 102601, 24, 2, 24007, "あたしも意外と\nやるもんでしょ？", "リン", 10040, "2030/12/17 14:59:59", 2, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 7, 102601, 24, 4, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 10040, "2030/12/17 14:59:59", 4, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 8, 102601, 24, 4, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 10040, "2030/12/17 14:59:59", 4, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 9, 102601, 24, 4, 24010, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 10040, "2030/12/17 14:59:59", 4, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 10, 102601, 24, 4, 24011, "やられた…\nねずみって意外と\nてごわいね", "リン", 10040, "2030/12/17 14:59:59", 4, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 11, 102601, 24, 4, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 10040, "2030/12/17 14:59:59", 4, 0.0, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES ("2020/04/30 12:00:00", 0.0, 12, 102601, 24, 4, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 10040, "2030/12/17 14:59:59", 1, 1.81, 0.0);
